"volume_range":{"id":"490258"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"490349","type":"CustomJS"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D9nAjk49MTvP+r6xj/+ZO8/BalMPNFC7z9fE3kUoEPvP4kK56MsXO8/QzvAaqk77z/2eNtLwT/vPya37TUYFu8/n7dZXXJN7z8X7cxhyYrvP7/sEH+TRu8/pjMuIvOc7z/U2PVXdW3vP5enWWu0Uu8/CN+fvXXT7z9C7H8Y8mDvP4+7lvHh6e4/VIYuSJqH7j/8uGFybD7uP9GUc11N/e0/5/byzQC+7T+jG0aK1I3tPyvPzsTvBe4/pek/9IEC7j+TVF59GcvtP9dMD8wN0+0/H4tm2WlI7j/XHz9q8M3uP2WMhYiP4O4/ib+Fsvyv7j8eZI1Qq7/uP2Xe1gozbO4/MgRos5DS7T/ausA/lx/uPyyjXgKw8+0/NkMk/kXW7T8SjbaCiC7uP4gCvfE9Bu4/8niNoPIV7j8tMTvAbT7uP6oA5Vvjxu0/tIujJOfK7T9k9tM+ndbtPzXp4oQ64e0/Z0gHRuDx7T/7w5ZbKPftP1dBUiumE+4/MjtV6SYA7j8AKykQgubtP2P7P1rj8O0/1xgPmhc77T+JQrL8CDjtP2Z+3DRCD+0/FrFOnnbO7D/ZngTLyc/sP4EUgG1z7ew/67Xw+EXc7D//twrc7
